pragma solidity >=0.4.22 <0.9.0;

import "./User.sol";

contract Stock{
    User public Us;
    uint public likecount=0; //所有喜好
    uint public buycount=0;//購買成功股票
    uint nowmoney; //使用者現有資產
    bool success_or_not=true; //使用者買賣股票成功與否判斷
    bool successhave_or_not=true; //使用者買賣股票成功與否判斷

    bool have=true; //判斷使用者是否擁有該股票
    uint finalcost; //此次購買的花費
    uint finalsell; //此次購買賺得

    uint public finalmoney; //使用者最終金額
    uint public Buy_length=0; //已購賣的股票陣列長度


    struct UserLikeStock{ //使用者喜好股票
        string user_account; //使用者帳號
        string stock_name; //股票名稱股票名稱
        string stock_price; //股票價格
        uint stock_calltime; //搜尋股票時間
    }

    struct UserStock{ //使用者持有的股票
        string user_account; //使用者帳號
        string stock_name; //股票名稱股票名稱
        string stock_price; //股票價格
        uint stock_number; //購買股票數量
        uint stock_calltime; //購買股票時間
    }

    constructor(address us)public{
        Us=User(us);
    }

    mapping(uint=> UserLikeStock) public Like;
    mapping(uint=> UserStock) public Buy;

    //儲存使用者喜好股票
    function UserLike(string memory _useraccount,string memory stock_name,string memory stock_price) public {
        bool exist;
        exist=Us.user_IsExist(_useraccount);
        if(exist==true){
            Like[likecount]=UserLikeStock(_useraccount,stock_name,stock_price,block.timestamp);
            likecount++;
        }
    }   


    //判斷使用者餘額是否足夠
    function User_Can_Buy_OR_NOT(string memory _useraccount,uint user_now_money,string memory stock_name,string memory stock_price,uint256 stock_number) public returns(bool,uint,uint){
        //bool success_or_not=true;
        //nowmoney=Us.user_get_money(_useraccount);
        nowmoney=user_now_money*1000; //使用者現有資產*1000
        bytes memory b = bytes(stock_price);
        uint result = 0; //此次購買的花費
        uint count=0;
        uint long=bytes(stock_price).length;
        for(uint i = 0; i < b.length; i++) {
            if(uint8(b[i]) >= 48 && uint8(b[i]) <= 57) {
                result = result * 10 + (uint8(b[i]) - 48);
                count ++;
            }
        }
        uint which;
        for(uint i = 0; i < b.length; i++) {
            if(uint8(b[i]) ==46) {
                which=i+1;
                break;
            }
        }
        if(count==long){
            result=result*100;
        }
        if((long-which)==1){
             result=result*10;

        }
        if((long-which)==2){
            result=result*1;
        }

        finalcost=result*stock_number;//此單最終花費
        if(finalcost>nowmoney){ //餘額不足
            success_or_not=false ;
        }
        else{
            success_or_not=true;
        }

        return (success_or_not,nowmoney,finalcost);
    } 
    //判斷使用者是否能購買股票
    function User_Can_Buy_OR_NOT_Result() public view returns(bool,uint,uint){ //判斷使用者是否能購買股票
        return (success_or_not,nowmoney,finalcost);
    }

    //使用者執行購買股票
    function User_Buy(string memory _useraccount,string memory stock_name,string memory stock_price,uint256 stock_number) public  returns(uint){
        finalmoney=nowmoney-finalcost;
        finalmoney=finalmoney/1000;
        bool havestock=false;
        for(uint i=0;i<Buy_length;i++){
            if((keccak256(abi.encode(_useraccount))==keccak256(abi.encode(Buy[i].user_account)))&& (keccak256(abi.encode(stock_name))==keccak256(abi.encode(Buy[i].stock_name)))){
                havestock=true;
                Buy[i].stock_number=Buy[i].stock_number+stock_number;
            }
        }
        if(havestock==false){
            Buy[buycount]=UserStock(_useraccount,stock_name,stock_price,stock_number,block.timestamp);
            Buy_length++;
            buycount++;
        }
        return finalmoney;
    }

    //取得使用者最終金額
    function user_get_finalmoney(string memory _useraccount) public  view returns(uint){

        return finalmoney;
    }

    //BUY陣列長度
    function howlong() public view returns(uint){
        return Buy_length;
    }

    //判斷使用者是否擁有該股票
    function User_Can_Sell_OR_NOT(string memory _useraccount,uint user_now_money,string memory stock_name,string memory stock_price,uint256 stock_number) public  returns(bool,uint,uint){ 
        nowmoney=user_now_money*1000; //使用者現有資產*1000
        bytes memory b = bytes(stock_price);
        uint result = 0; //此次購買的花費
        uint count=0;
        uint long=bytes(stock_price).length;
        for(uint i = 0; i < b.length; i++) {
            if(uint8(b[i]) >= 48 && uint8(b[i]) <= 57) {
                result = result * 10 + (uint8(b[i]) - 48);
                count ++;
            }
        }
        uint which;
        for(uint i = 0; i < b.length; i++) {
            if(uint8(b[i]) ==46) {
                which=i+1;
                break;
            }
        }
        if(count==long){
            result=result*100;
        }
        if((long-which)==1){
             result=result*10;

        }
        if((long-which)==2){
            result=result*1;
        }

        finalsell=result*stock_number;//此單賣出最終賺得

        //判斷是否持有該股票
        uint count2=0;
        for(uint i=0;i<Buy_length;i++){
            if((keccak256(abi.encode(_useraccount))==keccak256(abi.encode(Buy[i].user_account)))&& (keccak256(abi.encode(stock_name))==keccak256(abi.encode(Buy[i].stock_name)))){
                //count++;

                //需賣出的數量小於等於持有該股票數目 
                if(Buy[i].stock_number>=stock_number){
                    count2++;
                    successhave_or_not=true;
                }

            }
            else{
                successhave_or_not=false;
            }
        }

        if(count2!=0){
            successhave_or_not=true;
            return (successhave_or_not,nowmoney,finalsell);
        }
        else{
            successhave_or_not=false;
            return (successhave_or_not,nowmoney,finalsell);
        }
    }

    function User_Can_SELL_OR_NOT_Result() public view returns(bool,uint,uint){
        return (successhave_or_not,nowmoney,finalsell);
    }

    //使用者執行賣出股票
    function User_Sell(string memory _useraccount,string memory stock_name,string memory stock_price,uint256 stock_number) public  returns(uint){
        finalmoney=nowmoney+finalsell;
        finalmoney=finalmoney/1000;
        for(uint i=0;i<Buy_length;i++){
            if((keccak256(abi.encode(_useraccount))==keccak256(abi.encode(Buy[i].user_account)))&& (keccak256(abi.encode(stock_name))==keccak256(abi.encode(Buy[i].stock_name)))){
                Buy[i].stock_number=Buy[i].stock_number-stock_number;
            }
        }
        return finalmoney;
    }

